create sequence pasien_sq
   minvalue 1
  maxvalue 999999999
  start with 1
  increment by 1
  cache 20;

create or replace trigger pasien_sq_trig
before insert on pasien
for each row
declare
  new_id varchar(5);
  cur_id number;
begin
  if inserting and :new.id_pasien is null then
    cur_id := pasien_sq.nextval;
    if cur_id < 10 then
      select concat('P000', cur_id) into new_id from dual;
    else
      if cur_id < 100 then
        select concat('P00', cur_id) into new_id from dual;
      else 
        if cur_id < 1000 then
          select concat('P0', cur_id) into new_id from dual;
        else
          select concat('P', cur_id) into new_id from dual;
        end if;
      end if;
    end if;
  :new.id_pasien := new_id;
  end if;
end;

